    /**
     * Typography control class.
     *
     * @since  1.0.0
     * @access public
     */
    class Customizer_Typo_Control_Typography extends WP_Customize_Control {
        /**
         * The type of customize control being rendered.
         *
         * @since  1.0.0
         * @access public
         * @var    string
         */
        public $type = 'typography';
        /**
         * Array
         *
         * @since  1.0.0
         * @access public
         * @var    string
         */
        public $l10n = array();
        /**
         * Set up our control.
         *
         * @since  1.0.0
         * @access public
         * @param  object  $manager
         * @param  string  $id
         * @param  array   $args
         * @return void
         */
        public function __construct( $manager, $id, $args = array() ) {
            // Let the parent class do its thing.
            parent::__construct( $manager, $id, $args );
            // Make sure we have labels.
            $this->l10n = wp_parse_args(
                $this->l10n,
                array(
                    'family'            => esc_html__( 'Font Family', 'cww-portfolio-pro' ),
                    'size'              => esc_html__( 'Font Size',   'cww-portfolio-pro' ),
                    'weight'             => esc_html__( 'Font Weight', 'cww-portfolio-pro' ),
                    'style'            => esc_html__( 'Font Style', 'cww-portfolio-pro' ),
                    'line_height'       => esc_html__( 'Line Height', 'cww-portfolio-pro' ),
                    'text_decoration'   => esc_html__( 'Text Decoration', 'cww-portfolio-pro' ),
                    'text_transform'    => esc_html__( 'Text Transform', 'cww-portfolio-pro' ),
                    'typocolor'         => esc_html__( 'Font Color label', 'cww-portfolio-pro' ),
                )
            );
        }
        /**
         * Enqueue scripts/styles.
         *
         * @since  1.0.0
         * @access public
         * @return void
         */
        public function enqueue() {
            wp_enqueue_script( 'cww-portfolio-pro-customize-controls' );
            wp_enqueue_style(  'cww-portfolio-pro-customize-controls' );
            wp_enqueue_script( 'wp-color-picker' );
            wp_enqueue_style( 'wp-color-picker' );
        }
        /**
         * Add custom parameters to pass to the JS via JSON.
         *
         * @since  1.0.0
         * @access public
         * @return void
         */
        public function to_json() {
            parent::to_json();
            // Loop through each of the settings and set up the data for it.
            foreach ( $this->settings as $setting_key => $setting_id ) {
                $this->json[ $setting_key ] = array(
                    'link'  => $this->get_link( $setting_key ),
                    'value' => $this->value( $setting_key ),
                    'label' => isset( $this->l10n[ $setting_key ] ) ? $this->l10n[ $setting_key ] : ''
                );

                if ( 'family' === $setting_key )
                    $this->json[ $setting_key ]['choices'] = $this->get_font_families();


                elseif ( 'weight' === $setting_key )
                    $this->json[ $setting_key ]['choices'] = $this->get_font_weight_choices();


                elseif ( 'style' === $setting_key )
                    $this->json[ $setting_key ]['choices'] = $this->get_text_styles_choices();


                elseif ( 'text_transform' === $setting_key )
                    $this->json[ $setting_key ]['choices'] = $this->get_text_transform_choices();

                elseif ( 'text_decoration' === $setting_key )
                    $this->json[ $setting_key ]['choices'] = $this->get_text_decoration_choices();
            }
        }
