        /**
         * Returns the available font weights.
         *
         * @since  1.0.0
         * @access public
         * @return array
         */
        public function get_font_weight_choices() {
            if($this->settings['family']->id){
                $cww_portfolio_pro_font_list = get_option( 'cww_pp_google_fonts_val' );

                $font_family_id = $this->settings['family']->id;
                $default_font_family = $this->settings['family']->default;
                $get_font_family = get_theme_mod( $font_family_id, $default_font_family );

                $font_array = cww_portfolio_pro_search_key( $cww_portfolio_pro_font_list, 'family', $get_font_family );
            
                if(!empty( $font_array) ):
                $variants_array = $font_array['0']['variants'] ;
                $options_array = array();
                foreach ($variants_array  as $key => $variants ) {

                    if(is_numeric( $variants )){
                        $options_array[$variants] = $variants;    
                    }
                    
                }
                
                return $options_array;
                endif;
            }else{
            return array(
                '400' => esc_html__( 'Normal',     'cww-portfolio-pro' ),
                '700' => esc_html__( 'Bold',       'cww-portfolio-pro' ),
            );
            }
        }

        /**
        * Return font Styles
        *
        */
        public function get_text_styles_choices(){
            
             if($this->settings['family']->id){
                $cww_portfolio_pro_font_list = get_option( 'cww_pp_google_fonts_val' );

                $font_family_id = $this->settings['family']->id;
                $default_font_family = $this->settings['family']->default;
                $get_font_family = get_theme_mod( $font_family_id, $default_font_family );

                $font_array = cww_portfolio_pro_search_key( $cww_portfolio_pro_font_list, 'family', $get_font_family );
            
                if(!empty( $font_array) ):
                $variants_array = $font_array['0']['variants'] ;
                $options_array = array();
                foreach ($variants_array  as $key => $variants ) {

                    if(ctype_alpha( $variants )){
                        $options_array[$variants] = $variants;    
                    }
                    
                }
                
                return $options_array;
                endif;
            }
        }

